import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

// To resolve the file path error, the logic from the missing 'auth.js' file
// is now included directly in this component, making it self-contained.
const clearAuthToken = () => {
  localStorage.removeItem('token');
};

const Logout = () => {
  const navigate = useNavigate();

  useEffect(() => {
    // 1. Clear the token from storage.
    clearAuthToken();
    
    // 2. Navigate to the homepage. The Header will detect this change and update.
    navigate('/');

  }, [navigate]);

  return (
    <div style={{ textAlign: "center", padding: "5rem" }}>
      <h2>Logging you out...</h2>
    </div>
  );
};

export default Logout;
